import React from 'react';
import ReactDOM from 'react-dom';
import { Container } from '@material-ui/core';
import Form from './components/signUp';
import Navbar from './components/navbar';

ReactDOM.render(

    <Container>
        <Navbar/>
        <Form/>
    </Container>, 
    document.getElementById('root'));
